import React from 'react';
import Rolex from '../assets/pictures/rolex.jpg'
import { useState } from 'react'

function User() {
    const [pictureArr, SetPictureArr] = useState([{
        img: Rolex,
        name: 'Rolex 01',
        price: 100000
    },
    {
        img: Rolex,
        name: 'Rolex 02',
        price: 200000
    },
    {
        img: Rolex,
        name: 'Rolex 03',
        price: 300000
    },
    {
        img: Rolex,
        name: 'Rolex 04',
        price: 400000
    }])
    return (
        <>
            <main>
                <h1>User Page</h1>
                <div className='user'>
                    <img src={Rolex} />
                </div>
            </main>

        </>
    )
};

export default User
